package com.bokesoft.thirdparty.weixin.bean;

public class UserInfo {

	private String uname = null;
	
	private WeixinPublicNumber weixinPublicNumber = null;

	public WeixinPublicNumber getWeixinPublicNumber() {
		return weixinPublicNumber;
	}

	public void setWeixinPublicNumber(WeixinPublicNumber weixinPublicNumber) {
		this.weixinPublicNumber = weixinPublicNumber;
	}

	public String getUname() {
		return uname;
	}

	public void setUname(String uname) {
		this.uname = uname;
	}

}
